import React, { Fragment } from 'react';

const dummiTodos = [
    {
      id: 1,
      title: 'Todo Title',
      desc: 'Todo One Descripyion Is Here...'
    },
    {
        id: 2,
        title: 'Todo Title',
        desc: 'Todo Two Descripyion Is Here...'
      }
];

const AppHome = () => {
     
       return (
           <Fragment>
               {
                   dummiTodos
               }
           </Fragment>
       );
   };
   export default AppHome;
